      Debbie Chacona, the Memo Schedule A''s that itemize the committees share of
      the gross contributions received through the joint fundraising activities from
      the ASDC Dollars for Democrats and ASDC Partnership Program (Association of
      State Democratic Chairs), and the DNC Victory Fund (Democratic National Committee)
      are provided on a quarterly basis.    The transfer of the joint fundraising
      proceeds received during this reporting period from the DNC Victory Fund, ASDC
      Dollars for Democrats,  and the ASDC Partnership programs, represents the committee''s
